script: |
  super -f text -I q13888.spq | sort > q13888.out

inputs:
  - name: q13888.spq
    data: |
      SELECT DISTINCT + 38 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT - 16 * col1 * - ( - col0 ) - + col0 + 99 NOT BETWEEN col2 / + ( + col2 ) AND col0;
  - name: tab0

outputs:
  - name: q13888.out
    data: |
